import "./Home.css";
import TopRightMenu from "../Top Right Menu/TopRightMenu";
import FirstPage from "../First Page/FirstPage";
import LastPage from "../Last Page/LastPage";
import TopLeftMenu from "../Top Left Menu/TopLeftMenu";
import BottomLeftMenu from "../Bottom Left Menu/BottomLeftMenu";
import BottomRightMenu from "../Bottom Right Menu/BottomRightMenu";
import BottomFullMenu from "../Bottom Full Menu/BottomFullMenu";
import DrinksMenu from "../Drinks Menu/DrinksMenu";
import ImageMenuPage from "../Image Menu Page/ImageMenuPage";

MenuItem = {
  image: {
      position: "center",
      alt: "TEST",
      src: "../../Images/pancake.jpeg"
  },
  description_box: {
      style: "default",
      position: "top-right"
  }
}

function Home() {
  return (
      <>
      <section style={{backgroundColor: "#ECE0DB"}}>
        <FirstPage />
      </section>
      <section>
        <ImageMenuPage item={MenuItem}/>
      </section>
      <section>
        <TopRightMenu />
      </section>
      <section>
        <TopLeftMenu />
      </section>
      <section>
        <BottomLeftMenu />
      </section>
      <section>
        <BottomRightMenu />
      </section>
      <section>
        <BottomFullMenu />
      </section>
      <section>
        <DrinksMenu />
      </section>
      <section style={{backgroundColor: "#ECE0DB"}}>
        <LastPage />
      </section>
      </>
  );
}

export default Home;
